import Link from 'next/link';

function Container({ children }) {
  return (
    <div className="container mx-auto">
      <nav className="flex">
        <Link href="/">
          <a className="text-blue-500 hover:text-blue-800 mr-6">Index</a>
        </Link>
        <Link href="/about">
          <a className="text-blue-500 hover:text-blue-800 mr-6">About</a>
        </Link>
      </nav>
      {children}
    </div>
  );
}

export default Container;
